import React, {Component} from 'react';

class Control extends Component {
    render() {
      return (
        <ul>
          <li><a href='/create'></a>create</li>
          <li><a href='/update'></a>update</li>
          <li><input type='button' value='delete'></input></li>
        </ul>
      )
    }
  }

export default Control;
